import { withRouter } from 'next/router';

export default function Navbar() {
    return (
        <>
            <div>
                Objection
            </div>
            <style jsx>{`
                div {
                    position: relative;
                    z-index: 1;
                    left: 0;
                    width: 100%;
                    font-family: Verdana, sans-serif;
                    padding: 14px 16px;
                    background-color: #f1f1f1;
                    box-shadow: 4px 8px 6px -6px #888;
                }
            `}</style>
        </>
    );
}
